using namespace std;
class TrieNode 
{
public:
	// Initialize your data structure here.
	TrieNode* next[26];
	bool flag{ false };
	TrieNode() 
	{
		for (int i = 0; i < 26; i++)
		{
			next[i] = NULL;
		}
	}
	bool HasNext()
	{
		for (int i = 0; i < 26; i++)
		{
			if (next[i] != NULL)
				return true;
		}
		return false;
	}
};

class Trie 
{
public:
	Trie() {
		root = new TrieNode();
	}

	// Inserts a word into the trie.
	void insert(string word)
	{
		int pos = 0;
		TrieNode* pcur = root;
		while (pos < word.length())
		{
			if (pcur->next[word[pos] - 'a'] == NULL)
			{
				break;
			}
			pcur = pcur->next[word[pos] - 'a'];
			pos++;
		}
		if (pos == word.length())
		{
			pcur->flag = true;

			return;
		}
		while (pos < word.length())
		{
			pcur->next[word[pos] - 'a'] = new TrieNode();
			pcur = pcur->next[word[pos] - 'a'];
			pos++;
		}
		pcur->flag = true;
	}

	// Returns if the word is in the trie.
	bool search(string word)
	{
		int pos = 0;
		TrieNode* pcur = root;
		while (pos < word.length())
		{
			if (pcur->next[word[pos] - 'a'] == NULL)
			{
				return false;
			}
			pcur = pcur->next[word[pos] - 'a'];
			pos++;
		}
		if (pos == word.length() && pcur->flag == true) return true;
		return false;
	}

	// Returns if there is any word in the trie
	// that starts with the given prefix.
	bool startsWith(string word)
	{
		int pos = 0;
		TrieNode* pcur = root;
		while (pos < word.length())
		{
			if (pcur->next[word[pos] - 'a'] == NULL)
			{
				return false;
			}
			pcur = pcur->next[word[pos] - 'a'];
			pos++;
		}
		return true;
	}

private:
	TrieNode* root;
};
